import React from 'react';
import axios from 'axios';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';



export default class FooterForm extends React.Component {
    render() {
        return (
            <div id="kickstart-register">
                <Form id="regform-final">
                    <h1 id="reg-head"> Register </h1>
                    <h4 id="reg-sub"> Your final chance to sign up with a chance to get a free voodoo crate </h4>
                    <input className="kickregister" type="text" placeholder="Type your full name"></input>
                    <input className="kickregister" type="text" placeholder="Type your email"></input>
                    <Button className="submitreg" type="submit"> S u b m i t </Button>
                </Form>
            </div>
        );
    }

};
